// Header.js
import React from 'react';
import Typography from '@mui/material/Typography';

function Header() {
  return (
    <div>
      <img
        src="/kaiburrLogoText.png"
        alt="img"
        align="center"
        width="50%"
        height="50%"
            style={{
                border: '1px solid #ccc',  // Border color and thickness
                borderRadius: '5px',       // Border radius for rounded corners
                boxShadow: '2px 2px 5px #888888',  // Box shadow for a slight bevel effect
              }}
        />


      <Typography variant="h4" align="center" fontWeight="bold"> Web UI Front End </Typography>
    </div>
  );
}

export default Header;
